import React from 'react';

function Home({ userName }) {
  return (
    <div className="home-container">
      <h1>Bienvenido al Sistema de Reconocimiento Facial</h1>
      <div className="user-info">
        <h2>Bienvenido: {userName}</h2>
      </div>
    </div>
  );
}

export default Home;
